INSERT INTO rating (movie_id, rating_id, rating_url, rating_score, rating_timestamp_utc, critic, critic_likes, critic_comments, user_id, user_trialist, user_subscriber, user_eligible_for_trial, user_has_payment_method) VALUES ("1069", "14558450", "http://mubi.com/films/patti-smith-dream-of-life/ratings/14558450", 3.0, "2016-09-26 23:00:38", "This film did not seem as if it covered 10 years, except in her beginning outline of her public life.  So I felt it somewhat simplified it.  And that is my whole impression of this doc.  Simplified or trivialized, in many ways.  Unfocused.  I don't really appreciate her poetry as much as many poets in her circle.  I do like her music, however, which makes her poetry more accessible to me. Nicely shot, not so edited.", 0, 0, "7164304", False, False, True, True); 
